import React from 'react'
import { Formik, Form } from 'formik';
import App from './App';

export const Signup = () => {
    return (
        <Formik>
            {formik => (
            <div>
                <h1 className="my-4-font-weight-bold-display-4">Vosweet</h1>
            </div>    
            )}
        </Formik>
    )
}
